import { BlogPostFormComponent } from './components/blog-post-form/blog-post-form.component';
import { ToggleFormButtonComponent } from './components/toggle-form-button/toggle-form-button.component';
import { MatIconModule } from '@angular/material/icon'

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    SearchBarComponent,
    BlogsComponent,
    BlogPostFormComponent,
    ToggleFormButtonComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    HttpClientModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
